			&lt;div class=&#039;card-body&#039;&gt;
				&lt;p&gt;Setelah menemukan bobot dari masing-masing kriteria terhadap alternatif yang sudah ditentukan,
					langkah selanjutnya adalah mengalikan bobot prioritas kriteria dengan bobot dari masing-masing
					alternatif, kemudian hasil perkalian tersebut dijumlahkan perbaris. Sehingga didapatkan total
